const milisec_to_date = (date, format) => {
  switch (format) {
    case "yyyy-mm-dd":
      let arrayDate = date.split("-");
      let yyyy = arrayDate[0] - 1970;
      let mm = arrayDate[1];
      let dd = arrayDate[2];

      let day = new Date();
      console.log(yyy);
      break;

    default:
      break;
  }
};

export default milisec_to_date;
